function addCommasToNumber(text) {
  var result = "";
  var dotIndex = text.indexOf(".");
  var startIndex = text.length - 1;

  if (dotIndex >= 0) {
    result = text.substring(dotIndex);
    startIndex = dotIndex - 1;
  }

  var num = 0;

  for (var i = startIndex; i >= 0; i--) {
    result = text[i] + result;
    num += 1;

    if (num == 3 && i != 0) {
      result = "," + result;
      num = 0;
    }
  }

  return result;
}

